#include <map>
#include <string>

using namespace std;

int jump(int from , int to , vector<vector<char>> &tab , vector<int> &nums){
    if(tab[from][to] == -1){
        //cout << "from to ( " << from << " , " << to << endl;

        if(from == to){
            tab[from][to] = 1;
        }else{
            bool canJumpTo = false;
            
            int fromCount = nums[from];
            int index = 1;
            while(index <= fromCount){
                if(jump(from , from + index , tab , nums) == 1 && jump(from + index , to , tab , nums) == 1){
                    canJumpTo = true;
                    break;
                }
                index++;
            }//end while
            tab[from][to] = canJumpTo?1:0;
        }
    }
    return tab[from][to];
}

bool canJump2(vector<int>& nums) {
    const int len = nums.size();
    vector<vector<char>> tab(len , vector<char>(len , -1));

    // for(int i = 0 ; i < len ; i++){
    //     for(int j = 0; j < len ;j++){
    //         if(i == j){
    //             tab[i][j] = 1;
    //         }else{
    //             tab[i][j] = -1;
    //         }
    //     }//end for j
    // }//end for i

    for(int i = 0 ; i < nums.size();i++){
        int step = nums[i];
        for(int j = 1 ; j <= step && (i+ j) < len ;j++){
            // cout << "set " << i << " , " << (i + j) << " is 1"<< endl;
            tab[i][i + j] = 1;
        }
    }

    bool result = jump(0 , len - 1 , tab , nums);
    return result;
}

bool canReach(vector<int> &nums , int start , int end){
    if(end ==  start){
        //cout << start << " - " << end << " true" << endl;
        return true;
    }
    else if(end < start){
        //cout << start << " - " << end << " false" << endl;
        return false;
    }

    for(int i = start ; i <= end ;i++){
        int step = nums[start];

        for(int j = 1;j <= step;j++){
            if(canReach(nums , start + j , end)){
                cout << start << " - " << end << " true" << endl;
                return true;
            }
        }
    }//end for i

    cout << start << " - " << end << " false" << endl;
    return false;
}

bool canJump3(vector<int>& nums){
    const int len = nums.size();
    vector<vector<char>> tab(len , vector<char>(len , -1));
    return canReach(nums , 0 , len - 1);;
}


bool canJump(vector<int>& nums){
    const int len = nums.size();
   
    int index =0;
    int energy =0;

    while(index < len){
        int val = nums[index];
        energy = (val >= energy?val:energy);

        // cout << "index = " << index;
        // cout << "  energy = " << energy << endl;

        if(energy > 0){
            energy--;
            index++;
        }else{
            return index == len -1;
        }
    }//end while
    
    return true;
}

